import React from 'react';
import Piechart from '../Piechart/Piechart';

const testStats = [
  {"soda" : "Cola", "purchased": 58, color: '#d1e7ff'},
  {"soda" : "Fizz", "purchased" : 62, color: '#9cbcff'},
  {"soda" : "MegaPop", "purchased" : 31, color: '#fe4f60'},
  {"soda" : "Pop", "purchased" : 93, color: '#3961ff'}
]

function DataCard(props) {


    return ( 
    <>
        <div className="piechart-box">
            <div className="piechart">
                <Piechart data={testStats}/>
            </div>
            <div className="legend">
                <span className="chart-color" style={{ backgroundColor: props.data.color }}/>
                <h2 className="soda-name">{props.data.soda}</h2>
            </div>
        </div>
    </> );
}

export default DataCard;
